        return (
            <div className="PlaceholderContextualImage">
                    <Link to="b2hmfxezw2">
                        <img src="/media/Placeholder.png" alt="PlaceholderContextualImage" width="100%" height="auto" />
                    </Link>
          </div>
        )
    }
}

export default PlaceholderContextualImage;
